import styled from '@emotion/react';
const inputSearchStyle = styled`
    margin-top:"15px";
    margin-left:"15%";
    width:"70%";
`

const SearchForm = () => {
    return(
        <Input.Search css={inputSearchStyle}/>
    )
}

export default SearchForm;
